import React from "react";

function CheckoutPage() {
    return (
        <div className="CheckoutPage">
            <div className="container">
                <div className="row">
                    <div className="col-7">
                        <h3>CiCi - Thuong dinh yen</h3>
                    </div>
                    <div className="col-5"></div>
                </div>
            </div>
        </div>
    );
}

export default CheckoutPage;
